const oauth2Client = new google.auth.OAuth2(
    msg.payload.clientId,
    msg.payload.clientSecret,
    msg.payload.redirectUri
)

// Access scopes for read-only Drive activity.
const scopes = [
    'https://www.googleapis.com/auth/drive.metadata.readonly',
    'https://www.googleapis.com/auth/userinfo.email',
    'https://www.googleapis.com/auth/userinfo.profile'
];

// Generate a url that asks permissions for the Drive activity scope
const authorizationUrl = oauth2Client.generateAuthUrl({
    // 'online' (default) or 'offline' (gets refresh_token)
    access_type: 'offline',
    /** Pass in the scopes array defined above.
      * Alternatively, if only one scope is needed, you can pass a scope URL as a string */
    scope: scopes,
    // Enable incremental authorization. Recommended as a best practice.
    include_granted_scopes: true
});

msg.authorizationUrl = authorizationUrl;
msg.payload = {}
return msg;

msg.collection = "appSettings";
global.set("email", msg.oldpayload.email);
global.set("googleAppPassword", msg.oldpayload.googleAppPassword);
msg.payload = {    
    email: msg.oldpayload.email,
    googleAppPassword: msg.oldpayload.googleAppPassword,
    authorizationUrl: msg.authorizationUrl,
    deleted: false,
    createdAt: global.get("convert_date"),
    updatedAt: global.get("convert_date"),
    init: true
}

return msg;

msg.collection = "appSettings";

msg.payload = [
     {
    $match: {
        deleted: false
    }
},   
    {
        $project: {
            authorizationUrl: 1
        }
    }
]

return msg;

